Ông '''Chu Văn Đạt''' sinh 1952, xã Mỹ Tân, huyện Mỹ Lộc, tỉnh Nam Định.

Ông nguyên là giám đốc sở Tài chính tỉnh Nam Định, nguyên bí thư tỉnh ủy Nam Định, nguyên phó trưởng ban tuyên giáo Trung ương.

Ông nghỉ hưu năm 2012

Ông từng là [[đại biểu Quốc hội Việt Nam]] [[Quốc hội Việt Nam khóa XII|khóa XII]], thuộc đoàn đại biểu [[Nam Định]].<ref>{{chú thích web|url=http://dbqh.na.gov.vn/XII/Daibieu.aspx|publisher=[[Quốc hội Việt Nam]]|title=Danh sách Đại biểu Quốc hội khóa XII|access-date =ngày 6 tháng 9 năm 2012|archive-date = ngày 14 tháng 3 năm 2016 |archive-url=https://web.archive.org/web/20160314172223/http://dbqh.na.gov.vn/XII/Daibieu.aspx|url-status=dead}}</ref>

